import { transactionTypes } from "./types";

const searchRequest = { page: 0, size: 10 };

export function loadTransactionDetails(state = { transactionDetails }, action) {
    switch (action.type) {
      case transactionTypes.LOAD_TRANSACTION_DETAILS_SUCCESS:
        return {
          ...state,
          transactionDetails: action.response
        };
  
      default:
        return state;
    }
  }
